// Show Lonz sim button
var enablePersonalSim = true;

// Show Frenzy button
var enableFrenzyCalc = true;
var defaultFrenzyValue = 200;

// Show warnings (actions, party actions, house, village tax)
var enableWarnings = false;

// Show estimated end of personal quests
var enableQuestTimer = true;

var villageObserver = null;
var questObserver = null;
var actionsObserver = null;
var storage = null;
var mobList = null;
var actionWarningSpan = null;
var partyWarningSpan = null;
var taxWarningSpan = null;
var houseWarningSpan = null;
var questTimerInfoDisplayed = false;

window.addEventListener("load", startObserving);

function startObserving() {
    var mainContent = document.getElementsByTagName('app-gamecontent');
    if (!mainContent || !(mainContent)[0] || typeof getAllAngularRootElements !== "function" 
        || document.getElementsByTagName("app-menu")[0].children[0].children[1].getElementsByTagName("a").length < 10) {
      
        // it might be too early, try again in a second.
        setTimeout(startObserving, 1000);
    } else {
        var rootElement = getAllAngularRootElements()[0].children[2]["__ngContext__"][30];
        storage = rootElement.playerGeneralService;
        var target = (mainContent)[0];
        var contentObserver = new MutationObserver(function(mutations) {
            cleanUpObservers();
            mutations.forEach(function(mutation) {
                if (villageObserver == null && actionsObserver == null) {
                    mutation.addedNodes.forEach(addedNode => {
                        if (villageObserver == null && addedNode.localName === "app-village") {
                            villageObserver = new MutationObserver(function (mutations) {
                                checkQuestScreen();
                            });
                            villageObserver.observe(addedNode, {childList: true});
                        } else if (addedNode.localName === "app-actions") {
                            actionWarningSpan.style.display = "none";
                            if (actionsObserver == null) {
                                actionsObserver = new MutationObserver(function (mutations) {
                                    checkQuestScreen();
                                    addPersonalSimulateButton();
                                });
                                actionsObserver.observe(addedNode, {childList: true});
                            }
                        } else if (addedNode.localName === "app-party" && partyWarningSpan != null) {
                            partyWarningSpan.style.display = "none";
                        } else if (addedNode.localName === "app-house" && houseWarningSpan != null) {
                            houseWarningSpan.style.display = "none";
                        } else if (addedNode.localName === "app-homestead") {
                            var ratioButton = document.createElement("div");
                            ratioButton.className = "mat-raised-button";
                            ratioButton.style.fontSize = "15px";
                            ratioButton.style.lineHeight = "35px";
                            ratioButton.style.zIndex = "1";
                            ratioButton.textContent = "Calculate deco ratios";
                            ratioButton.onclick = function() {
                                setPlotRatios();
                            }
                            addedNode.getElementsByTagName("div")[0].append(ratioButton);
                        }
                        checkQuestScreen();
                        addPersonalSimulateButton();
                    });
                }
            });
        });
        contentObserver.observe(target, {childList: true});
        actionsNode = document.getElementsByTagName("app-actions");
        if (actionsObserver == null && actionsNode && actionsNode[0]) {
            actionsObserver = new MutationObserver(function (mutations) {
                checkQuestScreen();
                addPersonalSimulateButton();
            });
            actionsObserver.observe((actionsNode)[0], {childList: true});
        }
        addPersonalSimulateButton();
        if (enableFrenzyCalc) {
            showFrenzyButton(mainContent[0]);
        }
        if (enableWarnings) {
            addWarningSpans();
            startWarningChecks();
        }
    }
}

function addWarningSpans() {
    actionWarningSpan = document.createElement("span");
    actionWarningSpan.style.display = "none";
    actionWarningSpan.textContent = "LOW";
    actionWarningSpan.style.color = "white";
  
    partyWarningSpan = document.createElement("span");
    partyWarningSpan.style.display = "none";
    partyWarningSpan.textContent = "TIME";
    partyWarningSpan.style.color = "white";
  
    houseWarningSpan = document.createElement("span");
    houseWarningSpan.style.display = "none";
    houseWarningSpan.style.color = "white";
  
    taxWarningSpan = document.createElement("span");
    taxWarningSpan.style.display = "none";
    taxWarningSpan.textContent = "100% tax";
    taxWarningSpan.style.color = "white";

    Array.from(document.getElementsByTagName("app-menu")[0].children[0].children[1].getElementsByTagName("a")).forEach(menuDiv => {
      if (menuDiv.text.includes("Actions")) {
        menuDiv.appendChild(actionWarningSpan);
      } else if (menuDiv.text.includes("Party")) {
        menuDiv.appendChild(partyWarningSpan);
      } else if (menuDiv.text.includes("House")) {
        menuDiv.appendChild(houseWarningSpan);
      } else if (menuDiv.text.includes("Village")) {
        menuDiv.appendChild(taxWarningSpan);
      }
    });
}

function startWarningChecks() {
    if (storage.gameService.playerData.qol === "") {
        setTimeout(startWarningChecks, 10000);
    } else {
        checkActions();
        setInterval(checkActions, 300000);
        checkResTax();
        setInterval(checkResTax, 60000);
        if (Date.parse(storage.gameService.playerData.qol) > Date.now()) {
            checkHouseQueue();
            setInterval(checkHouseQueue, 3600000);
        }
    }
}

function checkActions() {
    if (storage.playerActionService.actions.remaining <= 600) {
        actionWarningSpan.style.display = "inline";
    } else {
        actionWarningSpan.style.display = "none";
    }
    if (!storage.partyService.isFighting) {
        var playerId = storage.gameService.playerData.id;
        var actionsRemaining = Math.min(5000, storage.partyService.partyOverview.partyInformation[playerId].actions.daily_actions_remaining);
        var resetHour = storage.gameService.playerSettingsService.backendSettings.daily_reset_hour;
        var nextReset = new Date();
        nextReset.setUTCHours(resetHour, 0, 0, 0);
        if (nextReset.getTime() < Date.now()) {
            nextReset.setDate(nextReset.getDate() + 1);
        }
        if (actionsRemaining > (5000 - 1440) && nextReset.getTime() - 600000 - (1440 - (5000 - actionsRemaining)) * 6000 <= Date.now()) {
            partyWarningSpan.style.display = "inline";
        } else {
            partyWarningSpan.style.display = "none";
        }
    } else {
        partyWarningSpan.style.display = "none";
    }
}

function checkResTax() {
    var resTax = storage.playerVillageService.taxSettings.resources_tax;
    var currentQuest = storage.playerVillageService.currentQuest[0];
    if (resTax === 100 && storage.playerVillageService.currentQuest.length == 1 && storage.playerVillageService.currentQuest[0].objective === "actions") {
        taxWarningSpan.style.display = "inline";
    } else {
        taxWarningSpan.style.display = "none";
    }
}

function checkHouseQueue() {
    if (storage.playerHouseService.houseQueue.length < 2) {
        houseWarningSpan.textContent = storage.playerHouseService.houseQueue.length + "/3";
        houseWarningSpan.style.display = "inline";
    } else {
        houseWarningSpan.style.display = "none";
    }
}

function checkQuestScreen() {
    var quests = null;
    var personalQuests = false;
    questTimerInfoDisplayed = false;
    if (window.location.href.endsWith("/village/quests")) {
        quests = document.getElementsByTagName("app-village-quests");
    } else if (window.location.href.endsWith("/actions/quests")) {
        quests = document.getElementsByTagName("app-quests");
        personalQuests = true;
    }
    if (quests) {
        if (questObserver != null) {
            questObserver.disconnect();
            questObserver = null;
        }
        var tableBody = (quests[0].firstElementChild.firstElementChild.getElementsByTagName("tbody"))[0];
        questObserver = new MutationObserver(function (mutations) {
            if (quests && quests[0]) {
                tableBody = (quests[0].firstElementChild.firstElementChild.getElementsByTagName("tbody"))[0];
                showVillageQuestInProgress(tableBody, personalQuests);
                processQuests(tableBody, getMultiplier(quests[0], personalQuests), personalQuests);
                questObserver.observe(tableBody, {childList: true});
            } else if (questObserver != null) {
                questObserver.disconnect();
                questObserver = null;
            }
        });
        showVillageQuestInProgress(tableBody, personalQuests);
        questObserver.observe((quests)[0], {childList: true});       
        questObserver.observe(tableBody, {childList: true});
        processQuests(tableBody, getMultiplier(quests[0], personalQuests), personalQuests);
    }
}

function setPlotRatios() {
    storage.playerHomesteadService.playerPlotData.forEach(plot => {
        plot.forEach(row => {
            if (typeof row !== "undefined") {
                row.name = getHomesteadCellRatio(row);
            }
        });
    });
    storage.playerHomesteadService.decorationList.forEach(cell => {
        cell.name = getHomesteadCellRatio(cell);
    });
}
                                                          
function getHomesteadCellRatio(cell) {
    return (cell.pet_exp_boost / (cell.size * cell.size)).toFixed(2) + "";
}

